import React, { useState } from "react";
import { Form, Button } from "react-bootstrap";

interface FormData {
  email?: string;
  password?: string;
}

interface FormErrors {
  email: boolean;
}

const Login = () => {
  const [fromData, setFormData] = useState<FormData>();
  const [formErrors, setFormErrors] = useState<FormErrors>({ email: true });

  return (
    <Form className="text-center">
      <Form.Group className="mb-3">
        <Form.Label>Meeting Id</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter meeting Id"
          onChange={(event) => {
            handleMeetingIDChanged(event.target.value);
          }}
          isInvalid={formErrors.meetingID}
        />
        <Form.Control.Feedback type="invalid">
          Please enter valid meeting id.
        </Form.Control.Feedback>
      </Form.Group>

      <Form.Group className="mb-3" controlId="username">
        <Form.Label>Username</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter username"
          onChange={(event) => {
            handleUsernameChanged(event.target.value);
          }}
          isInvalid={formErrors.username}
        />
        <Form.Control.Feedback type="invalid">
          Please enter username.
        </Form.Control.Feedback>
      </Form.Group>
      <Button
        variant="primary"
        type="submit"
        onClick={(event) => {
          event.preventDefault();
          handleJoinMeetingClicked();
        }}
      >
        Join meeting
      </Button>
    </Form>
  );
};

export default Login;
